    "tewaukon-national-wildlife-refuge-narrative-report-for-january-february-march-april-1956",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Tewaukon National
    Wildlife Refuge summarizes refuge activities from January through April of 1956.
     The report begins with a summary of the weather and habitat conditions during
    this period.  Wildlife- including migratory birds, upland game birds, big game animals,
    fur animals, predacious birds, and fish- is also covered.  The report includes a
    refuge development and maintenance section which discusses physical developments,
    plantings, collections, and receipts.  Economic uses of the refuge are outlined;
    grazing, haying, and fur harvest were the primary uses during this period.  A progress
    report on field investigation and applied research is also provided.  The public
    relations section of the report discusses recreational uses of the refuge, refuge
    visitors, refuge participation, fishing, and violations.  Finally, items of interest,
    information on easements and WPAs, and N-R forms are provided.",nt"license_title":
